 rgb(255, 255, 255);\\\" class=\\\" list-paddingleft-2\\\"><li><p>Thi\\u1ebft k\\u1ebf ti\\u1ec7n d\\u1ee5ng, ch\\u1eafc ch\\u1eafn.<\\/p><\\/li><li><p>Gh\\u1ebf \\u0111\\u01b0\\u1ee3c l\\u00e0m t\\u1eeb khung s\\u01a1n t\\u0129nh \\u0111i\\u1ec7n b\\u1ec1n ch\\u1eafc v\\u00e0 an to\\u00e0n cho ng\\u01b0\\u1eddi s\\u1eed d\\u1ee5ng. Ch\\u1ed7 ng\\u1ed3i mouse b\\u1ecdc simily mang \\u0111\\u1ebfn c\\u1ea3m gi\\u00e1c tho\\u1ea3i m\\u00e1i khi t\\u1eadp. S\\u1ea3n ph\\u1ea9m c\\u00f3 gh\\u1ebf ng\\u1ed3i \\u0111\\u1ec3 k\\u00e9o r\\u00f2ng r\\u1ecdc t\\u1eadp c\\u1eed \\u0111\\u1ed9ng 2 tay, c\\u00f3 bao tay gi\\u1eef b\\u00e0n tay y\\u1ebfu v\\u00e0o tay n\\u1eafm n\\u00ean ng\\u01b0\\u1eddi b\\u1ec7nh t\\u1eadp \\u0111\\u01b0\\u1ee3c c\\u1eed \\u0111\\u1ed9ng kh\\u1edbp vai nh\\u1edd tay m\\u1ea1nh k\\u00e9o tr\\u1ee3 gi\\u00fap. B\\u1ed9 ph\\u1eadn t\\u1eadp quay tay, b\\u1ed9 ph\\u1eadn \\u0111\\u1ea1p xe c\\u00f3 th\\u1ec3 \\u0111i\\u1ec1u ch\\u1ec9nh l\\u1ef1c n\\u1eb7ng nh\\u1eb9 theo l\\u1ef1c c\\u01a1 ng\\u01b0\\u1eddi b\\u1ec7nh. Chi\\u1ebfc gu\\u1ed1c bu\\u1ed9c ch\\u1eb7t ch\\u00e2n y\\u1ebfu c\\u1ee7a ng\\u01b0\\u1eddi b\\u1ec7nh v\\u00e0o b\\u00e0n \\u0111\\u1ea1p n\\u00ean ng\\u01b0\\u1eddi b\\u1ec7nh c\\u00f3 th\\u1ec3 t\\u1eadp \\u0111\\u1ea1p xe d\\u1ec5 d\\u00e0ng nh\\u1edd s\\u1ef1 tr\\u1ee3 gi\\u00fap c\\u1ee7a ch\\u00e2n m\\u1ea1nh.<\\/p><\\/li><li><p>\\u0110\\u1ed9ng t\\u00e1c linh ho\\u1ea1t, hi\\u1ec7u qu\\u1ea3.<\\/p><\\/li><li><p>B\\u1ed9 gh\\u1ebf \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf nhi\\u1ec1u ch\\u1ee9c n\\u0103ng, ng\\u01b0\\u1eddi t\\u1eadp c\\u00f3 th\\u1ec3 k\\u00e9o r\\u00f2ng r\\u1ecdc tr\\u1ee3 gi\\u00fap kh\\u1edbp vai, kh\\u1edbp kh\\u1ee7y, quay tay, \\u0111\\u1ea1p xe, k\\u00e9o c\\u1ed5\\u2026 L\\u00e0 b\\u1ed9 gh\\u1ebf th\\u00edch h\\u1ee3p cho ng\\u01b0\\u1eddi b\\u1ec7nh b\\u00e1n li\\u1ec7t do tai bi\\u1ebfn m\\u1ea1ch m\\u00e1u n\\u00e3o t\\u1eadp t\\u1ea1i nh\\u00e0.<\\/p><\\/li><li><p>K\\u00edch th\\u01b0\\u1edbc nh\\u1ecf g\\u1ecdn.<\\/p><\\/li><li><p>V\\u1edbi di\\u1ec7n t\\u00edch m\\u1eb7t ph\\u1ee7 g\\u1ecdn g\\u00e0ng, kh\\u00f4ng t\\u1ed1n di\\u1ec7n t\\u00edch b\\u1ea1n c\\u00f3 th\\u1ec3 ch\\u1ee7 \\u0111\\u1ed9ng t\\u1eadp luy\\u1ec7n b\\u1ea5t c\\u1ee9 khi n\\u00e0o b\\u1ea1n r\\u1ea3nh. Ch\\u1ec9 c\\u1ea7n t\\u00ecm t\\u01b0 th\\u1ebf tho\\u1ea3i m\\u00e1i nh\\u1ea5t v\\u00e0 b\\u1eaft \\u0111\\u1ea7u t\\u1eadp luy\\u1ec7n. Nh\\u1edd k\\u00edch th\\u01b0\\u1edbc nh\\u1ecf m\\u00e0 b\\u1ea1n c\\u00f3 th\\u1ec3 d\\u1ec5 di chuy\\u1ec3n t\\u1edbi nhi\\u1ec1u v\\u1ecb tr\\u00ed kh\\u00e1c nhau nh\\u01b0 v\\u1eeba xem tivi v\\u1eeba t\\u1eadp r\\u1ea5t ti\\u1ec7n l\\u1ee3i.<\\/p><\\/li><li><p>Ph\\u1ea7n \\u0111\\u1ea1p ch\\u00e2n&nbsp;c\\u00f3 th\\u1ec3 t\\u0103ng \\u2013 gi\\u1ea3m&nbsp;theo chi\\u1ec1u d\\u00e0i c\\u1ee7a ch\\u00e2n v\\u00e0 c\\u00f3 th\\u1ec3 th\\u00e1o r\\u1eddi.&nbsp;Ph\\u1ea7n quay tay c\\u00f3 th\\u1ec3 t\\u0103ng \\u2013 gi\\u1ea3m chi\\u1ec1u cao v\\u00e0 c\\u00f3 th\\u1ec3 th\\u00e1o r\\u1eddi.&nbsp;Ph\\u1ea7n \\u0111\\u1ea1p ch\\u00e2n v\\u00e0 tay quay c\\u00f3 th\\u1ec3 t\\u0103ng gi\\u1ea3m l\\u1ef1c kh\\u00e1ng. (quay n\\u1eb7ng nh\\u1eb9 t\\u00f9y ch\\u1ec9nh).&nbsp;Gh\\u1ebf c\\u00f3 th\\u1ec3 g\\u1eadp, x\\u1ebfp g\\u1ecdn.<\\/p><\\/li><\\/ul><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">CH\\u1ec8 \\u0110\\u1ecaNH<\\/p><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">\\u2013 Ng\\u01b0\\u1eddi tai bi\\u1ebfn.<\\/p><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">\\u2013 Ng\\u01b0\\u1eddi li\\u1ec7t n\\u1eeda ng\\u01b0\\u1eddi.<\\/p><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">\\u2013 Ng\\u01b0\\u1eddi b\\u1ec7nh c\\u1ea7n v\\u1eadn \\u0111\\u1ed9ng t\\u1ee9 chi.<\\/p><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">\\u2013 \\u0110\\u1eb7c bi\\u1ec7t hi\\u1ec7u qu\\u1ea3 trong \\u0111i\\u1ec1u tr\\u1ecb b\\u1ec7nh Parkinson.<\\/p><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">\\u2013 Ph\\u1ee5c h\\u1ed3i sau tai bi\\u1ebfn.<\\/p><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">\\u2013 D\\u00f9ng ph\\u1ee5c h\\u1ed3i tay ch\\u00e2n.<\\/p><p style=\\\"box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">\\u2013&nbsp;T\\u1eadp m\\u1ea1nh tay, \\u0111\\u1ea1p ch\\u00e2n, k\\u00e9o tay.<\\/p><ul style=\\\"box-sizing: border-box; list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans&quot;, sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\" class=\\\" list-paddingleft-2\\\"><li><p>Ng\\u01b0\\u1eddi b\\u00ecnh th\\u01b0\\u1eddng t\\u1eadp gi\\u00fap tay ch\\u00e2n kh\\u1ecfe m\\u1ea1nh, ph\\u00e1t tri\\u1ec3n \\u0111\\u1ec1u, t\\u0103ng c\\u01b0\\u1eddng s\\u1ee9c kh\\u1ecfe. Gh\\u1ebf&nbsp;d\\u00f9ng t\\u1eadp luy\\u1ec7n cho ng\\u01b0\\u1eddi b\\u1ecb y\\u1ebfu li\\u1ec7t n\\u1eeda ng\\u01b0\\u1eddi do tai bi\\u1ebfn m\\u1ea1ch m\\u00e1u n\\u00e3o v\\u00e0 c\\u00e1c ng\\u01b0\\u1eddi b\\u1ec7nh v\\u1ec1 x\\u01b0\\u01a1ng kh\\u1edbp.<\\/p><\\/li><li><p>Khung s\\u01a1n t\\u0129nh \\u0111i\\u1ec7n, ch\\u1ed7 ng\\u1ed3i mouse b\\u1ecdc simily.<\\/p><\\/li><li><p>\\u0110\\u1ed9ng t\\u00e1c \\u0111\\u01a1n gi\\u1ea3n, hi\\u1ec7u qu\\u1ea3.<\\/p><\\/li><\\/ul>\",\"_token\":\"rtG9FpPvYI6nBrzu9emBytOoaVElUkBEpfz4KGAP\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/foods\"}', '2024-04-03 09:22:52', '2024-04-03 09:22:52'),
