(631, 1, 'admin/medical-devices/12', 'PUT', '127.0.0.1', '{\"name\":\"Gi\\u01b0\\u1eddng b\\u1ec7nh nh\\u00e2n \\u0111i\\u1ec7n - c\\u01a1 \\u0111a ch\\u1ee9c n\\u0103ng Nikita DCN16\",\"type_id\":\"2\",\"price\":\"15500000\",\"location\":\"Vietnam\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"5\",\"description\":\"<p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">- Gi\\u01b0\\u1eddng b\\u1ec7nh nh\\u00e2n \\u0111i\\u1ec7n c\\u01a1 \\u0111a ch\\u1ee9c n\\u0103ng\\u00a0<a href=\\\"https:\\/\\/vienyte.vn\\/giuong-benh-nhan-dien-co-da-chuc-nang-nikita-nkt-dcn16\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" previewlistener=\\\"true\\\" style=\\\"box-sizing: border-box; background: 0px 0px; color: rgb(0, 128, 128); text-decoration-line: none; border: 0px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent; cursor: pointer; transition: color 0.15s ease-out 0s;\\\">NIKITA NKT-DCN16<\\/a><\\/span><\\/span>\\u00a0s\\u1eed d\\u1ee5ng \\u0111i\\u1ec7n \\u0111\\u1ec3 \\u0111i\\u1ec1u khi\\u1ec3n c\\u00e1c t\\u00ednh n\\u0103ng c\\u1ee7a gi\\u01b0\\u1eddng.<\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">- B\\u1ec7nh nh\\u00e2n c\\u00f3 th\\u1ec3 t\\u1ef1 \\u0111i\\u1ec1u khi\\u1ec3n, chuy\\u1ec3n \\u0111\\u1ed5i sang m\\u1ecdi t\\u01b0 th\\u1ebf mong mu\\u1ed1n m\\u00e0 kh\\u00f4ng c\\u1ea7n \\u0111\\u1ebfn s\\u1ef1 tr\\u1ee3 gi\\u00fap c\\u1ee7a ng\\u01b0\\u1eddi kh\\u00e1c. Gi\\u1ea3m thi\\u1ec3u vi\\u1ec7c ch\\u0103m s\\u00f3c c\\u1ee7a ng\\u01b0\\u1eddi nh\\u00e0 v\\u00e0 nh\\u00e2n vi\\u00ean \\u0111i\\u1ec1u d\\u01b0\\u1ee1ng.<br style=\\\"box-sizing: border-box;\\\">-\\u00a0<span style=\\\"box-sizing: border-box; color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u0110\\u1eb7c bi\\u1ec7t gi\\u01b0\\u1eddng b\\u1ec7nh t\\u1ef1 \\u0111\\u1ed9ng\\u00a0<\\/span><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128); font-family: roboto, arial, sans-serif; font-size: 14px;\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">NKT-DCN16<\\/span><\\/span><span style=\\\"box-sizing: border-box; color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u00a0c\\u00f3 tay quay ph\\u1ee5 \\u0111i k\\u00e8m. Khi m\\u1ea5t \\u0111i\\u1ec7n c\\u00f3 th\\u1ec3 d\\u00f9ng tay quay \\u0111\\u1ec3 \\u0111i\\u1ec1u khi\\u1ec3n c\\u00e1c t\\u00ednh n\\u0103ng c\\u1ee7a gi\\u01b0\\u1eddng b\\u1ec7nh.<\\/span><br><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">Gi\\u01b0\\u1eddng b\\u1ec7nh nh\\u00e2n \\u0111i\\u1ec7n DNC-16 l\\u00e0 gi\\u01b0\\u1eddng b\\u1ec7nh \\u0111i\\u1ec1u khi\\u1ec3n b\\u1eb1ng \\u0111i\\u1ec7n c\\u00f3 t\\u1edbi 16 t\\u00ednh n\\u0103ng \\u01b0u vi\\u1ec7t nh\\u01b0 sau:<\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">1<\\/span>. N\\u00e2ng l\\u01b0ng t\\u1eeb 0\\u00b0 \\u2013 80\\u00b0.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">2<\\/span>. H\\u1ea1 l\\u01b0ng t\\u1eeb 80\\u00b0- 0\\u00b0.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">3<\\/span>. N\\u00e2ng ch\\u00e2n \\u0111\\u1ebfn 45\\u00b0 ( treo ch\\u00e2n tr\\u00e1nh ph\\u00f9 n\\u1ec1 ).<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">4<\\/span>. H\\u1ea1 ch\\u00e2n \\u0111\\u1ebfn g\\u00f3c 90\\u00b0 ( h\\u1ea1 th\\u1ea5p k\\u1ebft h\\u1ee3p d\\u1ef1ng \\u0111\\u1ea7u t\\u1ea1o th\\u00e0nh t\\u01b0 th\\u1ebf ng\\u1ed3i tho\\u1ea3i m\\u00e1i ).<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">5<\\/span>. L\\u1eadt nghi\\u00eang ng\\u01b0\\u1eddi sang tr\\u00e1i 0\\u00b0 \\u2013 60\\u00b0.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">6<\\/span>. L\\u1eadt nghi\\u00eang ng\\u01b0\\u1eddi sang ph\\u1ea3i t\\u1eeb 0\\u00b0 \\u2013 60\\u00b0.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">7<\\/span>. C\\u00e2y truy\\u1ec1n d\\u1ecbch.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">8<\\/span>. G\\u1ed9i \\u0111\\u1ea7u t\\u1ea1i gi\\u01b0\\u1eddng.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">9<\\/span>. B\\u00f4 v\\u1ec7 sinh: \\u0111i \\u0111\\u1ea1i, ti\\u1ec3u ti\\u1ec7n ngay t\\u1ea1i gi\\u01b0\\u1eddng.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">10<\\/span>. T\\u01b0 th\\u1ebf xe l\\u0103n.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">11<\\/span>. B\\u00e1nh xe ch\\u1ecbu l\\u1ef1c 4 chi\\u1ec1u gi\\u00fap \\u0111\\u1ea9y gi\\u01b0\\u1eddng nh\\u1eb9 nh\\u00e0ng.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">12<\\/span>. B\\u00e0n \\u0103n c\\u01a1 \\u0111\\u1ed9ng.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">13<\\/span>. Th\\u00e0nh gi\\u01b0\\u1eddng c\\u01a1 \\u0111\\u1ed9ng, b\\u1ea3o v\\u1ec7 an to\\u00e0n.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">14<\\/span>. \\u00d4m vai, gi\\u00fap ng\\u1ed3i th\\u1eb3ng an to\\u00e0n.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">15<\\/span>. N\\u00e2ng \\u0111\\u00f9i, gi\\u00fap \\u0111i v\\u1ec7 sinh d\\u1ec5 d\\u00e0ng h\\u01a1n.<\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">16<\\/span>. Khi m\\u1ea5t \\u0111i\\u1ec7n, gi\\u01b0\\u1eddng c\\u00f3 th\\u1ec3 chuy\\u1ec3n sang ch\\u1ebf \\u0111\\u1ed9 tay quay \\u0111\\u1ec3 s\\u1eed d\\u1ee5ng.<\\/span><br style=\\\"box-sizing: border-box;\\\"><span style=\\\"box-sizing: border-box; color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">Nguy\\u00ean b\\u1ed9 s\\u1ea3n ph\\u1ea9m bao g\\u1ed3m: c\\u00e2y truy\\u1ec1n, b\\u00e0n \\u0103n, \\u0111\\u1ec7m y t\\u1ebf b\\u1eb1ng s\\u01a1 d\\u1eeba, b\\u00f4 v\\u1ec7 sinh, ch\\u1eadu g\\u1ed9i \\u0111\\u1ea7u.<\\/span><\\/p><p>Th\\u00f4ng S\\u1ed1 K\\u1ef9 Thu\\u1eadt<br><\\/p><p><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u2013 K\\u00edch th\\u01b0\\u1edbc s\\u1eed d\\u1ee5ng: D\\u00e0i 2100mm x R\\u1ed9ng 900mm x Cao 500mm.<\\/span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u2013 K\\u00edch th\\u01b0\\u1edbc \\u0111\\u00f3ng ki\\u1ec7n: D\\u00e0i 1980mm x R\\u1ed9ng 990mm x Cao 300mm.<\\/span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-col