 text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u2013 Khung gi\\u01b0\\u1eddng: S\\u1eaft s\\u01a1n t\\u0129nh \\u0111i\\u1ec7n.<\\/span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u2013 Thanh ch\\u1eafn 2 b\\u00ean: H\\u1ee3p kim nh\\u00f4m.<\\/span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u2013 Th\\u00e0nh \\u0111\\u1ea7u v\\u00e0 cu\\u1ed1i gi\\u01b0\\u1eddng: Nh\\u1ef1a ABS.<\\/span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u2013 C\\u00e2y truy\\u1ec1n d\\u1ecbch: C\\u00f3.<\\/span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121,