le=\\\"color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">-\\u00a0 T\\u1ea3i tr\\u1ecdng: 250kg<\\/span><br style=\\\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\\\">\\u2013 B\\u1ea3o h\\u00e0nh: 12 th\\u00e1ng.<\\/span><\\/p>\",\"_token\":\"0uA8PrVjQgSKw7quofU4Goia2hkhW7twDxAT9X4k\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/medical-devices\"}', '2024-04-11 03:40:07', '2024-04-11 03:40:07'),
