(637, 1, 'admin/medical-devices/14', 'PUT', '127.0.0.1', '{\"name\":\"Gh\\u1ebf t\\u1eadp v\\u1eadt l\\u00fd tr\\u1ecb li\\u1ec7u 3 trong 1\",\"type_id\":\"2\",\"price\":\"2099000\",\"location\":\"Vietnam\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"5\",\"description\":\"<p style=\'box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: \\\"Open Sans\\\", sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\'><span style=\\\"box-sizing: border-box; font-weight: bolder;\\\">C\\u00d4NG D\\u1ee4NG<\\/span><\\/p><ul style=\'box-sizing: border-box; list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: \\\"Open Sans\\\", sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\' class=\\\" list-paddingleft-2\\\"><li><p>T\\u1eadp ph\\u1ee5c h\\u1ed3i c\\u01a1 kh\\u1edbp.<\\/p><\\/li><li><p>T\\u1eadp m\\u1ea1nh c\\u00e1c c\\u01a1 b\\u00ean ph\\u1ea7n kh\\u00f4ng c\\u1eed \\u0111\\u1ed9ng.<\\/p><\\/li><li><p>T\\u1eadp kh\\u1ea3 n\\u0103ng ph\\u1ee5c h\\u1ed3i ph\\u1ea3n x\\u1ea1 d\\u00e2y th\\u1ea7n kinh.<\\/p><\\/li><li><p>T\\u1eadp k\\u00e9o c\\u0103ng, du\\u1ed7i, co gi\\u00e3n c\\u00e1c kh\\u1edbp tay, ch\\u00e2n.<\\/p><\\/li><li><p>K\\u00edch th\\u00edch tu\\u1ea7n ho\\u00e0n m\\u00e1u cung c\\u1ea5p tr\\u1edf l\\u1ea1i c\\u00e1c v\\u00f9ng b\\u1ecb t\\u00ea li\\u1ec7t.<\\/p><\\/li><\\/ul><p style=\'box-sizing: border-box; margin-bottom: 1.3em; margin-top: 0px; font-family: \\\"Open Sans\\\", sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\'><span style=\\\"box-sizing: border-box; font-weight: bolder;\\\">\\u0110\\u1eb6C \\u0110I\\u1ec2M N\\u1ed4I B\\u1eacT<\\/span><\\/p><ul style=\'box-sizing: border-box; list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: \\\"Open Sans\\\", sans-serif; text-wrap: wrap; background-color: rgb(255, 255, 255);\' class=\\\" list-paddingleft-2\\\"><li><p>Thi\\u1ebft k\\u1ebf ti\\u1ec7n d\\u1ee5ng, ch\\u1eafc ch\\u1eafn.<\\/p><\\/li><li><p>Gh\\u1ebf \\u0111\\u01b0\\u1ee3c l\\u00e0m t\\u1eeb khung s\\u01a1n t\\u0129nh \\u0111i\\u1ec7n b\\u1ec1n ch\\u1eafc v\\u00e0 an to\\u00e0n cho ng\\u01b0\\u1eddi s\\u1eed d\\u1ee5ng. Ch\\u1ed7 ng\\u1ed3i mouse b\\u1ecdc simily mang \\u0111\\u1ebfn c\\u1ea3m gi\\u00e1c tho\\u1ea3i m\\u00e1i khi t\\u1eadp. S\\u1ea3n ph\\u1ea9m c\\u00f3 gh\\u1ebf ng\\u1ed3i \\u0111\\u1ec3 k\\u00e9o r\\u00f2ng r\\u1ecdc t\\u1eadp c\\u1eed \\u0111\\u1ed9ng 2 tay, c\\u00f3 bao tay gi\\u1eef b\\u00e0n tay y\\u1ebfu v\\u00e0o tay n\\u1eafm n\\u00ean ng\\u01b0\\u1eddi b\\u1ec7nh t\\u1eadp \\u0111\\u01b0\\u1ee3c c\\u1eed \\u0111\\u1ed9ng kh\\u1edbp vai nh\\u1edd tay m\\u1ea1nh k\\u00e9o tr\\u1ee3 gi\\u00fap. B\\u1ed9 ph\\u1eadn t\\u1eadp quay tay, b\\u1ed9 ph\\u1eadn \\u0111\\u1ea1p xe c\\u00f3 th\\u1ec3 \\u0111i\\u1ec1u ch\\u1ec9nh l\\u1ef1c n\\u1eb7ng nh\\u1eb9 theo l\\u1ef1c c\\u01a1 ng\\u01b0\\u1eddi b\\u1ec7nh. Chi\\u1ebfc gu\\u1ed1c bu\\u1ed9c ch\\u1eb7t ch\\u00e2n y\\u1ebfu c\\u1ee7a ng\\u01b0\\u1eddi b\\u1ec7nh v\\u00e0o b\\u00e0n \\u0111\\u1ea1p n\\u00ean ng\\u01b0\\u1eddi b\\u1ec7nh c\\u00f3 th\\u1ec3 t\\u1eadp \\u0111\\u1ea1p xe d\\u1ec5 d\\u00e0ng nh\\u1edd s\\u1ef1 tr\\u1ee3 gi\\u00fap c\\u1ee7a ch\\u00e2n m\\u1ea1nh.<\\/p><\\/li><li><p>\\u0110\\u1ed9ng t\\u00e1c linh ho\\u1ea1t, hi\\u1ec7u qu\\u1ea3.<\\/p><\\/li><li><p>B\\u1ed9 gh\\u1ebf \\u0111\\u01b0\\u1ee3c thi\\u1ebft k\\u1ebf nhi\\u1ec1u ch\\u1ee9c n\\u0103ng, ng\\u01b0\\u1eddi t\\u1eadp c\\u00f3 th\\u1ec3 k\\u00e9o r\\u00f2ng r\\u1ecdc tr\\u1ee3 gi\\u00fap kh\\u1edbp vai, kh\\u1edbp kh\\u1ee7y, quay tay, \\u0111\\u1ea1p xe, k\\u00e9o c\\u1ed5\\u2026 L\\u00e0 b\\u1ed9 gh\\u1ebf th\\u00edch h\\u1ee3p cho ng\\u01b0\\u1eddi b\\u1ec7nh b\\u00e1n li\\u1ec7t do tai bi\\u1ebfn m\\u1ea1ch m\\u00e1u n\\u00e3o t\\u1eadp t\\u1ea1i nh\\u00e0.<\\/p><\\/li><li><p>K\\u00edch th\\u01b0\\u1edbc nh\\u1ecf g\\u1e