u00f4ng c\\u1ea7n c\\u00e0i \\u0111\\u1eb7t<\\/span><\\/span><\\/p><\\/li><li><p><span style=\\\"box-sizing: border-box;\\\"><span style=\\\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\\\">K\\u1ebft qu\\u1ea3 nhanh v\\u00e0 ch\\u00ednh x\\u00e1c sau 10 gi\\u00e2y\\u00a0<\\/span><\\/span><\\/p><\\/li><li><p><span style=\\\"box-sizing: border-box;\\\"><span style=\\\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\\\">C\\u1ea3nh b\\u00e1o k\\u1ebft qu\\u1ea3 qu\\u00e1 cao, qu\\u00e1 th\\u1ea5p<\\/span><\\/span><\\/p><\\/li><li><p><span style=\\\"box-sizing: border-box;\\\"><span style=\\\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\\\">\\u0110o v\\u1edbi lo\\u1ea1i que th\\u1eed On - Call Pluss<\\/span><\\/span><\\/p><\\/li><\\/ul>\",\"_token\":\"0uA8PrVjQgSKw7quofU4Goia2hkhW7twDxAT9X4k\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/medical-devices\"}', '2024-04-11 03:41:16', '2024-04-11 03:41:16'),
