(691, 1, 'admin/medical-devices/12', 'PUT', '127.0.0.1', '{\"name\":\"Gi\\u01b0\\u1eddng b\\u1ec7nh nh\\u00e2n \\u0111i\\u1ec7n - c\\u01a1 \\u0111a ch\\u1ee9c n\\u0103ng Nikita DCN16\",\"type_id\":\"2\",\"price\":\"15500000\",\"location\":\"Vietnam\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"5\",\"description\":\"<p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box; color: rgb(0, 128, 128);\\\"><span style=\\\"box-sizing: border-box; font-weight: 700;\\\">- Gi\\u01b0\\u1eddng b\\u1ec7nh nh\\u00e2n \\u0111i\\u1ec7n c\\u01a1 \\u0111a ch\\u1ee9c n\\u0103ng\\u00a0<a href=\\\"https:\\/\\/vienyte.vn\\/giuong-benh-nhan-dien-co-da-chuc-nang-nikita-nkt-dcn16\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\" previewlistener=\\\"true\\\" style=\\\"box-sizing: border-box; background: 0px 0px; color: rgb(0, 128, 128); text-decoration-line: none; border: 0px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent; cursor: pointer; transition: color 0.15s ease-out 0s;\\\">NIKITA NKT-DCN16<\\/a><\\/span><\\/span>\\u00a0s\\u1eed d\\u1ee5ng \\u0111i\\u1ec7n \\u0111\\u1ec3 \\u0111i\\u1ec1u khi\\u1ec3n c\\u00e1c t\\u00ednh n\\u0103ng c\\u1ee7a gi\\u01b0\\u1eddng.<\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">- B\\u1ec7nh nh\\u00e2n c\\u00f3 th\\u1ec3 t\\u1ef1 \\u0111i\\u1ec1u khi\\u1ec3n, chuy\\u1ec3n \\u0111\\u1ed5i sang m\\u1ecdi t\\u01b0 th\\u1ebf mong mu\\u1ed1n m\\u00e0 kh\\u00f4ng c\\u1ea7n \\u0111\\u1ebfn s\\u1ef1 tr\\u1ee3 gi\\u00fap c\\u1ee7a ng\\u01b0\\u1eddi kh\\u00e1c. Gi\\u1ea3m thi\\u1ec3u vi\\u1ec7c ch\\u0103m s\\u00f3c c\\u1ee7a ng\\u01b0\\u1eddi nh\\u00e0 v\\u