(12, 'Giường bệnh nhân điện - cơ đa chức năng Nikita DCN16', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">- Giường bệnh nhân điện cơ đa chức năng <a href=\"https://vienyte.vn/giuong-benh-nhan-dien-co-da-chuc-nang-nikita-nkt-dcn16\" rel=\"noopener noreferrer\" target=\"_blank\" previewlistener=\"true\" style=\"box-sizing: border-box; background: 0px 0px; color: rgb(0, 128, 128); text-decoration-line: none; border: 0px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; -webkit-tap-highlight-color: transparent; cursor: pointer; transition: color 0.15s ease-out 0s;\">NIKITA NKT-DCN16</a></span></span> sử dụng điện để điều khiển các tính năng của giường.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">- Bệnh nhân có thể tự điều khiển, chuyển đổi sang mọi tư thế mong muốn mà không cần đến sự trợ giúp của người khác. Giảm thiểu việc chăm sóc của người nhà và nhân viên điều dưỡng.<br style=\"box-sizing: border-box;\">- <span style=\"box-sizing: border-box; color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">Đặc biệt giường bệnh tự động </span><span style=\"box-sizing: border-box; color: rgb(0, 128, 128); font-family: roboto, arial, sans-serif; font-size: 14px;\"><span style=\"box-sizing: border-box; font-weight: 700;\">NKT-DCN16</span></span><span style=\"box-sizing: border-box; color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\"> có tay quay phụ đi kèm. Khi mất điện có thể dùng tay quay để điều khiển các tính năng của giường bệnh.</span><br></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">Giường bệnh nhân điện DNC-16 là giường bệnh điều khiển bằng điện có tới 16 tính năng ưu việt như sau:</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">1</span>. Nâng lưng từ 0° – 80°.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">2</span>. Hạ lưng từ 80°- 0°.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">3</span>. Nâng chân đến 45° ( treo chân tránh phù nề ).</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">4</span>. Hạ chân đến góc 90° ( hạ thấp kết hợp dựng đầu tạo thành tư thế ngồi thoải mái ).</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">5</span>. Lật nghiêng người sang trái 0° – 60°.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">6</span>. Lật nghiêng người sang phải từ 0° – 60°.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">7</span>. Cây truyền dịch.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">8</span>. Gội đầu tại giường.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">9</span>. Bô vệ sinh: đi đại, tiểu tiện ngay tại giường.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">10</span>. Tư thế xe lăn.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">11</span>. Bánh xe chịu lực 4 chiều giúp đẩy giường nhẹ nhàng.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">12</span>. Bàn ăn cơ động.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">13</span>. Thành giường cơ động, bảo vệ an toàn.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">14</span>. Ôm vai, giúp ngồi thẳng an toàn.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">15</span>. Nâng đùi, giúp đi vệ sinh dễ dàng hơn.</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; color: rgb(0, 128, 128);\"><span style=\"box-sizing: border-box; font-weight: 700;\">16</span>. Khi mất điện, giường có thể chuyển sang chế độ tay quay để sử dụng.</span><br style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">Nguyên bộ sản phẩm bao gồm: cây truyền, bàn ăn, đệm y tế bằng sơ dừa, bô vệ sinh, chậu gội đầu.</span></p><p>Thông Số Kỹ Thuật<br></p><p><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Kích thước sử dụng: Dài 2100mm x Rộng 900mm x Cao 500mm.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Kích thước đóng kiện: Dài 1980mm x Rộng 990mm x Cao 300mm.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Bảng điều khiển: Có.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Tay quay phụ: Có.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Nâng lưng: Có.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Nâng chân: Có ( treo chân tránh phù nề ).</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Nghiêng người trái phải: Có.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Khung giường: Sắt sơn tĩnh điện.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Thanh chắn 2 bên: Hợp kim nhôm.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Thành đầu và cuối giường: Nhựa ABS.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Cây truyền dịch: Có.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Bàn ăn: Có.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Bô vệ sinh: Có.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Bánh xe: 4 bánh có phanh hãm.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Đệm: Xơ dừa.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Trọng lượng giường: 75 Kg.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-  Tải trọng: 250kg</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255); color: rgb(121, 121, 121); font-family: roboto, arial, sans-serif; font-size: 14px;\">– Bảo hành: 12 tháng.</span></p>', 15500000, 4, 5, 5, 'images/dcdd665f6d3d694e457c34b8d48b1038.png', 'Vietnam', '2024-04-03 09:19:15', '2024-04-11 04:00:07', 2),
(13, 'Máy đo huyết áp và SpO2 - Contec08A', '<p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Máy đo huyết áp và SpO2 - Contec08A là một thiết bị huyết áp kế điện tử để bàn, màn hình LCD. Thiết bị này là một máy đo huyết áp sử dụng trong gia đình dành cho người lớn, trẻ em và trẻ sơ sinh.<br style=\"box-sizing: border-box;\">-Đo chỉ số huyết áp hoàn toàn tự động.<br style=\"box-sizing: border-box;\">-Lưu trữ các kết quả đo của ba người dùng sau mỗi lần đo, và mỗi người dùng có thể lưu trữ<br style=\"box-sizing: border-box;\">-Với chế độ đo: người lớn, trẻ em và trẻ sơ sinh. Tùy đối tượng sử dụng mà chọn kích thước túi hơi cho phù hợp.<br style=\"box-sizing: border-box;\">-Giao diện lưu trữ và truy xuất dữ liệu: dạng \"danh sách dữ liệu\", \"đồ thị xu hướng\", \"font chữ lớn\", dữ liệu huyết áp không xâm lấn NIBP được truy xuất và hiển thị một cách rõ ràng trong nháy mắt.<br style=\"box-sizing: border-box;\">-Có các chức năng cảnh báo: người dùng có thể thiết lập các giới hạn báo động, khi huyết áp cao hơn giới hạn cao hoặc thấp hơn giới hạn thấp, thiết bị sẽ phát ra âm thanh báo động. Sử dụng công tắc Alarm switch để thiết lập các chỉ số báo động một cách dễ dàng.<br style=\"box-sizing: border-box;\">-Khi có những yếu tố ảnh hưởng đến việc đo lường của các quá trình đo và các thiết bị sẽ không thể có được kết quả đo lường, thiết bị có thể hiển thị các thông báo lỗi tương ứng.<br style=\"box-sizing: border-box;\">-Khi pin yếu hoặc thay pin mới sẽ không ảnh hưởng đến các chức năng đồng hồ thời gian và kết quả lưu trữ.<br style=\"box-sizing: border-box;\">-Cung cấp hai loại đơn vị đo huyết áp không xâm lấn NIBP là: mmHg / kPa.<br style=\"box-sizing: border-box;\">-Kết quả đo sẽ hiển thị cùng với ngày và giờ đã đo.<br style=\"box-sizing: border-box;\">-<span style=\"box-sizing: border-box; font-weight: 700;\">Chức năng theo dõi liên tục nồng độ Oxy bão hòa trong máu SpO2.</span><br style=\"box-sizing: border-box;\">-Giao tiếp với máy tính thông qua cổng USB, phần mềm kết nối máy tính giúp rà soát dữ liệu, phân tích các kết quả đo lường, dự báo xu hướng của huyết áp, in báo cáo và các chức năng khác.<br style=\"box-sizing: border-box;\">-Màn hình hiển thị thông báo nhắc nhở khi pin nguồn sắp hết, và phát ra âm thanh nhắc nhở. Có thể được thiết lập âm báo cho mức pin thấp. <span style=\"box-sizing: border-box; font-weight: 700;\">Chức năng tự động tắt nguồn</span>.</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; color: rgb(43, 43, 43);\">Monitor theo dõi bệnh nhân 2 thông số-Model CONTEC08A là một thiết bị huyết áp kế điện tử để bàn, màn hình màu LCD với độ nét cao, dùng để đo huyết áp tự động một cách trực quan. Thiết bị này là một máy đo huyết áp sử dụng trong gia đình dành cho người lớn, trẻ em và trẻ sơ sinh. Thiết bị này có chức năng đo đạc các thông số, hiển thị, ghi nhận, lưu trữ và truy xuất dữ liệu thông qua giao diện như \"danh sách dữ liệu\", \"biểu đồ xu hướng\", \"font chữ lớn\", và đặc biệt có chức năng đo SpO2 dùng để theo dõi nồng độ Oxy bão hòa trong máu – 1 trong những chỉ số sinh tồn quan trọng của con người. Nó được sử dụng cho các phòng mạch, trung tâm thể thao và dùng để chăm sóc sức khỏe hàng ngày của gia đình.</span></span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; color: rgb(43, 43, 43);\">Thiết bị này thích hợp sử dụng để theo dõi tình trạng sức khỏe cho các em bé sơ sinh thiếu tháng tại nhà.</span></span></span></p><p>Thông Số Kỹ Thuật<br></p><p><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">Máy đo huyết áp và SpO2 - Contec 08A</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-Phương pháp đo huyết áp: Oscillometry.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-Đối tượng sử dụng: người lớn và trẻ em.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-Các chỉ số đo lường: Huyết áp tâm thu (SYS), huyết áp tâm trương (DIA), huyết áp trung bình (MAP) và nhịp mạch (HR)</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-Đơn vị đo lường: có thể lựa chọn giữa mmHg và Kpa.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-Phạm vi đo lường áp lực: 0 mmhg đến 280mmHg.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-Độ chính xác: ± 3 mmHg.</span><br style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\">-Độ phân giải: ± 1 mmHg.</span></p>', 3200000, 4, 5, 5, 'images/7d262664db6859a13c41afe807d240fe.png', 'Vietnam', '2024-04-03 09:20:49', '2024-04-11 04:00:15', 2),
