(18, 'Máy đo đường huyết Acon On-Call EZ II', '<ul style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\" class=\" list-paddingleft-2\"><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Máy đo đường huyết On-Call EZ II do Hãng ACON Laboratories Inc. sản xuất chính là để đạt tới mục tiêu cung cấp một thiết bị kiểm tra đường huyết chất lượng cao với giá cả mà bạn có thể đo nồng độ đường huyết rất thường xuyên theo yêu cầu của mình</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Công nghệ cảm ứng sinh học. Men que thử GOD. Tự động cài mã que thử bằng chíp. Khoảng đo 1.1- 33.3 mmol/L (20-600)</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Chỉ 1 μL mẫu máu toàn phần từ đầu ngón tay, gan bàn tay và trên cánh tay ( mao mạch ). Phạm vi Hct ( tỷ lệ hồng cầu ) 30- 55%</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Bộ nhớ 100 kết quả ( không kèm ngày tháng và thời gian đo )</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Màn hình LCD 31 x 30.5mm</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Kích thước máy 48 x 82 x 17mm</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Trọng lượng máy 38 gram</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">1 pin nguồn CR2032 (3.0V) cho khoảng 1000 lần đo</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Đơn giản hóa và giảm bớt các chức năng khác của máy như thời gian, tính trung bình, truyền dữ liệu với máy tính...</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Âm báo tự động</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Đo ngay không cần cài đặt</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Kết quả nhanh và chính xác sau 10 giây&nbsp;</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Cảnh báo kết quả quá cao, quá thấp</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Đo với loại que thử On - Call Pluss</span></span></p></li></ul>', 700000, 4, 5, 5, 'images/eed7a2c262e37962b969dab4c53096ea.png', 'Vietnam', '2024-04-11 23:31:45', '2024-04-11 23:31:45', 3),
(19, 'Máy xông mũi họng Omron NEC28 (NE-C28)', '<h3 style=\"box-sizing: border-box; font-family: Arial; font-weight: 500; line-height: 1.1; color: rgb(51, 51, 51); margin: 0px; font-size: 16px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Máy xông mũi họng&nbsp;Omron NE-C28&nbsp;</span>thuộc dòng máy nén khí không nóng, dễ sử dụng và đảm bảo vệ sinh, là sản phẩm lý tưởng cho việc chăm sóc sức khỏe gia đình bạn.Nhỏ, gọn, nhẹ, tiện lợi cho đi du lịch, công tác.</span></span></h3><ul style=\"box-sizing: border-box; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\" class=\" list-paddingleft-2\"><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">An toàn và dễ dàng vệ sinh.</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Xông mũi họng hiệu quả.</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Bộ lọc có thể thay thế</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Máy có độ bền cao, chuyên nghiệp, điều trị bệnh một cách hiệu quả.</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Kích thước máy: 158 (rộng) x 100 (cao) x 175 (dầy) mm</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Trọng lượng: 1,9kg</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Tốc độ phun khí: 0,4 ml/phút.</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Dung tích cốc thuốc: 7ml</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Kích thước hạt: 5 micron</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Phụ kiện kèm theo</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Túi đựng.</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">5 miếng lọc dự phòng</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Hướng dẫn sử dụng.</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Các phụ kiện khác.</span></span></p></li><li><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Sử dụng máy xông mũi họng NE-C28</span></span></p></li></ul>', 1350000, 4, 4, 4, 'images/1c732167de4c36d1d08d2c282a3a35bc.png', 'Vietnam', '2024-04-19 21:48:38', '2024-04-19 21:50:03', 2),
(20, 'Máy xông hơi mặt Beurer FS50', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Với Máy xông hơi da mặt FS 50 của Beurer<span style=\"box-sizing: border-box;text-decoration:underline;\">&nbsp;</span></span>được nhập khẩu từ Đức sẽ giúp bạn tiết kiệm thời gian hơn khi chăm sóc da. Bạn không cần phải đến trung tâm làm đẹp mà vẫn có thể tự chăm sóc cho da ngay tại nhà mình.</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Máy xông hơi sẽ giúp da mặt bạn được chuẩn bị một cách tốt nhất để tiếp nhận các phương pháp chăm sóc da như làm sạch sâu, giữ ẩm, đắp mặt nạ…</span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Thiết bị bao gồm:</span></span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">- Khay chứa hương liệu tạo nên tác động kép</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">- Cốc để đo lường</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Sản phẩm đạt tiêu chuẩn chất lượng của liên minh châu Âu CE</span></span></p><p><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Công suất 120 Watt</span></span><br style=\"box-sizing: border-box;\"/>&nbsp;</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">Tác dụng của&nbsp;Máy xông hơi da mặt&nbsp;Beurer FS50:</span></span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">-&nbsp;Máy xông hơi da mặt&nbsp;làm cho các lỗ chân lông được mở ra, các tế bào da có thể thư giãn dưới cái nóng ẩm đồng thời độc tố trong cơ thể và trên da mặt cũng được bài tiết ra ngoài;</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">- Giải quyết tận gốc nguyên nhân gây mụn, trứng cá và viêm nhiễm trên da mặt;</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">&nbsp;- Làm sạch da mặt một cách triệt để;</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">&nbsp;- Xông hơi kết hợp với hương liệu thiên nhiên hoặc dược phẩm tạo nên tác động kép, giúp cho việc hấp thụ tốt nhất các sản phẩm chăm sóc da, cải thiện tốt nhất cho làn da;</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">&nbsp;- Xông hơi kết hợp với massage và sử dụng các sản phẩm chăm sóc da (thảo mộc và dược phẩm) làm mềm da, tăng tính đàn hồi và làm trẻ hóa da;</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">- Có thể xông hơi để làm sạch mũi họng;</span></span></p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\">- Thiết kế đơn giản, hợp lý, phù hợp với người Á Đông;</span></span></p>', 1450000, 4, 5, 5, 'images/fa22d164a1a8686be50e4667c748a6fb.png', 'Vietnam', '2024-04-19 21:54:20', '2024-04-19 21:54:20', 2),
(21, 'Đai cột sống Bonbone Japan', '<h3 style=\"box-sizing: border-box; font-family: Arial; font-weight: 500; line-height: 1.1; color: rgb(51, 51, 51); margin: 0px; font-size: 16px; border: 0px; outline: 0px; padding: 0px; vertical-align: baseline; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\">Đai cột sống Bonbone Japan</span></span></span></h3><p><span style=\"box-sizing: border-box; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\"><span style=\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\"><span style=\"box-sizing: border-box; font-weight: 700;\"><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">Hỗ trợ điều trị đau thắt lưng cấp tính và mãn tính.</span><br style=\"box-sizing: border-box;\"/><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">Thông số kỹ thuật:</span></span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">Chất liệu đàn hồi nhẹ, thoáng, 6 thanh nhựa tổng hợp hỗ trợ nâng đỡ vùng lưng.</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">Thiết kế trợ lực giảm sức kéo.</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">Chiều rộng mặt trước: 11.5 cm.</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">Chiều rộng mặt sau: 20 cm.</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">Kích thước: Đo vòng bụng</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">S: 58 - 73 cm</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">M: 68 - 85 cm</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">L: 80 - 100 cm</span><br style=\"box-sizing: border-box;\"/><span style=\"box-sizing: border-box; color: rgb(0, 0, 0);\">XL: 95 - 120 cm</span></span></span></p><p></p>', 950000, 5, 4, 5, 'images/fc8b8a55fdb6fcd1e95ea85388985dff.png', 'Vietnam', '2024-04-19 21:56:26', '2024-04-19 21:56:26', 3);
