(52, 100005, 13, 3200000, '{\"id\":13,\"name\":\"M\\u00e1y \\u0111o huy\\u1ebft \\u00e1p v\\u00e0 SpO2 - Contec08A\",\"description\":\"<p><span style=\\\"box-sizing: border-box;\\\"><span style=\\\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\\\">M\\u00e1y \\u0111o huy\\u1ebft \\u00e1p v\\u00e0 SpO2 - Contec08A l\\u00e0 m\\u1ed9t thi\\u1ebft b\\u1ecb huy\\u1ebft \\u00e1p k\\u1ebf \\u0111i\\u1ec7n t\\u1eed \\u0111\\u1ec3 b\\u00e0n, m\\u00e0n h\\u00ecnh LCD. Thi\\u1ebft b\\u1ecb n\\u00e0y l\\u00e0 m\\u1ed9t m\\u00e1y \\u0111o huy\\u1ebft \\u00e1p s\\u1eed d\\u1ee5ng trong gia \\u0111\\u00ecnh d\\u00e0nh cho ng\\u01b0\\u1eddi l\\u1edbn, tr\\u1ebb em v\\u00e0 tr\\u1ebb s\\u01a1 sinh.<br style=\\\"box-sizing: border-box;\\\">-\\u0110o ch\\u1ec9 s\\u1ed1\\u00a0huy\\u1ebft \\u00e1p\\u00a0ho\\u00e0n to\\u00e0n\\u00a0t\\u1ef1 \\u0111\\u1ed9ng.<br style=\\\"box-sizing: border-box;\\\">-L\\u01b0u tr\\u1eef c\\u00e1c k\\u1ebft qu\\u1ea3 \\u0111o c\\u1ee7a ba ng\\u01b0\\u1eddi d\\u00f9ng sau m\\u1ed7i l\\u1ea7n \\u0111o, v\\u00e0 m\\u1ed7i ng\\u01b0\\u1eddi d\\u00f9ng c\\u00f3 th\\u1ec3 l\\u01b0u tr\\u1eef<br style=\\\"box-sizing: border-box;\\\">-V\\u1edbi ch\\u1ebf \\u0111\\u1ed9 \\u0111o: ng\\u01b0\\u1eddi l\\u1edbn, tr\\u1ebb em v\\u00e0 tr\\u1ebb s\\u01a1 sinh. T\\u00f9y \\u0111\\u1ed1i t\\u01b0\\u1ee3ng s\\u1eed d\\u1ee5ng m\\u00e0 ch\\u1ecdn k\\u00edch th\\u01b0\\u1edbc t\\u00fai h\\u01a1i cho ph\\u00f9 h\\u1ee3p.<br style=\\\"box-sizing: border-box;\\\">-Giao di\\u1ec7n l\\u01b0u tr\\u1eef v\\u00e0 truy xu\\u1ea5t\\u00a0d\\u1eef li\\u1ec7u:\\u00a0d\\u1ea1ng \\\"danh s\\u00e1ch d\\u1eef li\\u1ec7u\\\", \\\"\\u0111\\u1ed3 th\\u1ecb xu h\\u01b0\\u1edbng\\\", \\\"font ch\\u1eef l\\u1edbn\\\", d\\u1eef li\\u1ec7u huy\\u1ebft \\u00e1p kh\\u00f4ng x\\u00e2m l\\u1ea5n NIBP \\u0111\\u01b0\\u1ee3c truy xu\\u1ea5t v\\u00e0 hi\\u1ec3n th\\u1ecb m\\u1ed9t c\\u00e1ch r\\u00f5 r\\u00e0ng\\u00a0trong nh\\u00e1y m\\u1eaft.<br style=\\\"box-sizing: border-box;\\\">-C\\u00f3 c\\u00e1c ch\\u1ee9c n\\u0103ng c\\u1ea3nh b\\u00e1o:\\u00a0ng\\u01b0\\u1eddi d\\u00f9ng c\\u00f3 th\\u1ec3\\u00a0thi\\u1ebft l\\u1eadp c\\u00e1c gi\\u1edbi h\\u1ea1n b\\u00e1o \\u0111\\u1ed9ng, khi huy\\u1ebft \\u00e1p cao h\\u01a1n gi\\u1edbi h\\u1ea1n cao ho\\u1eb7c th\\u1ea5p h\\u01a1n gi\\u1edbi h\\u1ea1n th\\u1ea5p, thi\\u1ebft b\\u1ecb s\\u1ebd ph\\u00e1t ra \\u00e2m thanh b\\u00e1o \\u0111\\u1ed9ng. S\\u1eed d\\u1ee5ng c\\u00f4ng t\\u1eafc Alarm switch \\u0111\\u1ec3 thi\\u1ebft l\\u1eadp c\\u00e1c ch\\u1ec9 s\\u1ed1 b\\u00e1o \\u0111\\u1ed9ng m\\u1ed9t c\\u00e1ch d\\u1ec5 d\\u00e0ng.<br style=\\\"box-sizing: border-box;\\\">-Khi c\\u00f3 nh\\u1eefng y\\u1ebfu t\\u1ed1 \\u1ea3nh h\\u01b0\\u1edfng \\u0111\\u1ebfn vi\\u1ec7c \\u0111o l\\u01b0\\u1eddng c\\u1ee7a c\\u00e1c qu\\u00e1 tr\\u00ecnh \\u0111o v\\u00e0 c\\u00e1c thi\\u1ebft b\\u1ecb s\\u1ebd kh\\u00f4ng th\\u1ec3 c\\u00f3 \\u0111\\u01b0\\u1ee3c k\\u1ebft qu\\u1ea3 \\u0111o l\\u01b0\\u1eddng, thi\\u1ebft b\\u1ecb c\\u00f3 th\\u1ec3 hi\\u1ec3n th\\u1ecb c\\u00e1c th\\u00f4ng b\\u00e1o l\\u1ed7i t\\u01b0\\u01a1ng \\u1ee9ng.<br style=\\\"box-sizing: border-box;\\\">-Khi\\u00a0pin y\\u1ebfu ho\\u1eb7c thay pin m\\u1edbi s\\u1ebd kh\\u00f4ng \\u1ea3nh h\\u01b0\\u1edfng \\u0111\\u1ebfn c\\u00e1c ch\\u1ee9c n\\u0103ng \\u0111\\u1ed3ng h\\u1ed3 th\\u1eddi gian v\\u00e0 k\\u1ebft qu\\u1ea3 l\\u01b0u tr\\u1eef.<br style=\\\"box-sizing: border-box;\\\">-Cung c\\u1ea5p hai lo\\u1ea1i \\u0111\\u01a1n v\\u1ecb \\u0111o huy\\u1ebft \\u00e1p kh\\u00f4ng x\\u00e2m l\\u1ea5n NIBP l\\u00e0: mmHg \\/ kPa.<br style=\\\"box-sizing: border-box;\\\">-K\\u1ebft qu\\u1ea3 \\u0111o s\\u1ebd hi\\u1ec3n th\\u1ecb c\\u00f9ng v\\u1edbi\\u00a0ng\\u00e0y v\\u00e0 gi\\u1edd \\u0111\\u00e3 \\u0111o.<br style=\\\"box-sizing: border-box;\\\">-<span style=\\\"box-sizing: border-box; font-weight: 700;\\\">Ch\\u1ee9c n\\u0103ng theo d\\u00f5i li\\u00ean t\\u1ee5c n\\u1ed3ng \\u0111\\u1ed9 Oxy b\\u00e3o h\\u00f2a trong m\\u00e1u SpO2.<\\/span><br style=\\\"box-sizing: border-box;\\\">-Giao ti\\u1ebfp v\\u1edbi m\\u00e1y t\\u00ednh th\\u00f4ng qua c\\u1ed5ng USB, ph\\u1ea7n m\\u1ec1m k\\u1ebft n\\u1ed1i m\\u00e1y t\\u00ednh gi\\u00fap\\u00a0r\\u00e0 so\\u00e1t d\\u1eef li\\u1ec7u, ph\\u00e2n t\\u00edch c\\u00e1c k\\u1ebft qu\\u1ea3 \\u0111o l\\u01b0\\u1eddng, d\\u1ef1 b\\u00e1o xu h\\u01b0\\u1edbng c\\u1ee7a huy\\u1ebft \\u00e1p, in b\\u00e1o c\\u00e1o v\\u00e0 c\\u00e1c ch\\u1ee9c n\\u0103ng kh\\u00e1c.<br style=\\\"box-sizing: border-box;\\\">-M\\u00e0n h\\u00ecnh hi\\u1ec3n th\\u1ecb th\\u00f4ng b\\u00e1o nh\\u1eafc nh\\u1edf khi pin ngu\\u1ed3n s\\u1eafp h\\u1ebft, v\\u00e0 ph\\u00e1t ra \\u00e2m thanh nh\\u1eafc nh\\u1edf.\\u00a0C\\u00f3 th\\u1ec3 \\u0111\\u01b0\\u1ee3c thi\\u1ebft l\\u1eadp \\u00e2m b\\u00e1o cho m\\u1ee9c pin th\\u1ea5p.\\u00a0<span style=\\\"box-sizing: border-box; font-weight: 700;\\\">Ch\\u1ee9c n\\u0103ng t\\u1ef1 \\u0111\\u1ed9ng t\\u1eaft ngu\\u1ed3n<\\/span>.<\\/span><\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box;\\\"><span style=\\\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\\\"><span style=\\\"box-sizing: border-box; color: rgb(43, 43, 43);\\\">Monitor theo d\\u00f5i b\\u1ec7nh nh\\u00e2n 2 th\\u00f4ng s\\u1ed1-Model CONTEC08A l\\u00e0 m\\u1ed9t thi\\u1ebft b\\u1ecb\\u00a0huy\\u1ebft \\u00e1p k\\u1ebf \\u0111i\\u1ec7n t\\u1eed \\u0111\\u1ec3 b\\u00e0n, m\\u00e0n h\\u00ecnh m\\u00e0u LCD v\\u1edbi \\u0111\\u1ed9 n\\u00e9t cao, d\\u00f9ng \\u0111\\u1ec3 \\u0111o huy\\u1ebft \\u00e1p t\\u1ef1 \\u0111\\u1ed9ng m\\u1ed9t c\\u00e1ch tr\\u1ef1c quan. Thi\\u1ebft b\\u1ecb n\\u00e0y\\u00a0l\\u00e0 m\\u1ed9t m\\u00e1y \\u0111o huy\\u1ebft \\u00e1p s\\u1eed d\\u1ee5ng trong gia \\u0111\\u00ecnh d\\u00e0nh\\u00a0cho ng\\u01b0\\u1eddi l\\u1edbn, tr\\u1ebb em v\\u00e0 tr\\u1ebb s\\u01a1 sinh. Thi\\u1ebft b\\u1ecb n\\u00e0y c\\u00f3 ch\\u1ee9c n\\u0103ng \\u0111o \\u0111\\u1ea1c c\\u00e1c th\\u00f4ng s\\u1ed1, hi\\u1ec3n th\\u1ecb, ghi nh\\u1eadn, l\\u01b0u tr\\u1eef\\u00a0v\\u00e0 truy xu\\u1ea5t d\\u1eef li\\u1ec7u th\\u00f4ng qua giao di\\u1ec7n nh\\u01b0 \\\"danh s\\u00e1ch d\\u1eef li\\u1ec7u\\\", \\\"bi\\u1ec3u \\u0111\\u1ed3 xu h\\u01b0\\u1edbng\\\", \\\"font ch\\u1eef l\\u1edbn\\\", v\\u00e0 \\u0111\\u1eb7c bi\\u1ec7t c\\u00f3 ch\\u1ee9c n\\u0103ng \\u0111o SpO2 d\\u00f9ng \\u0111\\u1ec3 theo d\\u00f5i n\\u1ed3ng \\u0111\\u1ed9 Oxy b\\u00e3o h\\u00f2a trong m\\u00e1u \\u2013 1 trong nh\\u1eefng ch\\u1ec9 s\\u1ed1 sinh t\\u1ed3n quan tr\\u1ecdng c\\u1ee7a con ng\\u01b0\\u1eddi. N\\u00f3 \\u0111\\u01b0\\u1ee3c s\\u1eed d\\u1ee5ng cho c\\u00e1c ph\\u00f2ng m\\u1ea1ch, trung t\\u00e2m th\\u1ec3 thao\\u00a0v\\u00e0 d\\u00f9ng \\u0111\\u1ec3 ch\\u0103m s\\u00f3c s\\u1ee9c kh\\u1ecfe h\\u00e0ng ng\\u00e0y c\\u1ee7a gia \\u0111\\u00ecnh.<\\/span><\\/span><\\/span><\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(51, 51, 51); font-family: Arial; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\"><span style=\\\"box-sizing: border-box;\\\"><span style=\\\"box-sizing: border-box; font-family: arial, helvetica, sans-serif;\\\"><span style=\\\"box-sizing: border-box; color: rgb(43, 43, 43);\\\">Thi\\u1ebft b\\u1ecb n\\u00e0y th\\u00edch h\\u1ee3p s\\u1eed d\\u1ee5ng \\u0111\\u1ec3 theo d\\u00f5i t\\u00ecnh tr\\u1ea1ng s\\u1ee9c kh\\u1ecfe cho c\\u00e1c em b\\u00e9 s\\u01a1 sinh thi\\u1ebfu th\\u00e1ng t\\u1ea1i nh\\u00e0.<\\/span><\\/span><\\/span><\\/p><p>Th\\u00f4ng S\\u1ed1 K\\u1ef9 Thu\\u1eadt<br><\\/p><p><span style=\\\"color: rgb(51, 51, 51); font-family: arial, helvetica, sans-serif; text-align: justify; text-wrap: wrap; background-color: rgb(255, 255, 255);\\\">M\\u00e1y \\u0111o huy\\u1ebft \\u00e1p v\\u00e0 SpO2 - Contec 08A<\\/span><br sty